import Box from '@mui/material/Box';
import Skeleton from '@mui/material/Skeleton';

export default function ModelDetail() {
  return (
    <>
        <Skeleton animation="wave" variant='rounded' width={'300'} height={10} />
      
    </>
      
  );
}
